import AllQuotes from "./pages/AllQuotes";
import NewQuote from "./pages/NewQuote";
import QuoteDetail from "./pages/QuoteDetail";


function App() {

  return (
    <Switch>
      <Route path='/quotes'>
        <AllQuotes/>
      </Route>
      <Route path='/quotes/:quotedId'>

      </Route>
      <Route path='/new-quote'></Route>
    </Switch>  
  );
}

export default App;
